import React from 'react'
import { connect } from 'react-redux'

const UserListing = (props) => {
    return (
        <table>
            <thead>
                <tr>
                    <th>Name</th>
                    <th>Email</th>
                    <th></th>
                </tr>
            </thead>
            <tbody>
                {
                    props.users.map((user) => {
                        <tr key={user.name}>
                            <td>{user.name}</td>
                            <td>{user.email}</td>
                            <td></td>
                        </tr>
                    })
                }
            </tbody>
        </table>
    )
}

const mapStateToProps = (state) => {
    console.log(state);
    return {
        users: state.users
    }
}

export default connect(mapStateToProps)(UserListing)
